import "./App.css";
import Navbar from "./components/NavBar";
import SongList from "./components/SongList";
import SongForm from "./components/SongForm";

function App() {
  return (
    <div className="App">
      {/* <SongContextProvider> */}
      <Navbar />
      <SongList />
      <SongForm />
      {/* </SongContextProvider> */}
    </div>
  );
}

export default App;
